import Layout from '../components/layout';
import Title from '../components/title';

const Index = () => {
  return (
    <>
    <Layout>

      <Title>Info Casas</Title>

      <div className='container'>
        <form>
          <input type="search" placeholder="Agregar"/>
        </form>

        <div className="cont">
          <div className="item">
            <span>Titulo</span>
          </div>
        </div>
      </div>
    </Layout>
    </>
  );
};

export default Index;
